import React from "react";

const Project = ({ project }) => {
  const { id, name } = project;
  return (
    <div key={project.id.value}>
      <h1>Project {project.id.name}</h1>
      <h3>Name: {project.shortname}</h3>
    </div>
  );
};

export default Project;
